const InitialDisplay = (props) => (
    <div className="container reveal main slide-left grow teal darken-2 z-depth-3">
        <h4 className="reveal reveal-2 slide-top">{props.title}</h4>
        <div className="reveal reveal-3 slide-left">{props.body}</div>
    </div>
);

export default InitialDisplay;
